import React from 'react';
import SongCard from './SongCard';
import { withRouter } from 'react-router-dom';
class SongContainer extends React.Component{
  state = {
    songs: []
  }
  render(){
    return(
      <div>
      <h1>Song Container</h1>
      <SongCard/>
      </div>
    )
  }
}

export default withRouter(SongContainer);
